import * as React from 'react';
import styles from '../../styles/App.module.scss';
import classNames from 'classnames/bind';
import pen from '../../assets/images/testPen.png';
import { LogoTitle /* , Button */ } from '../../styles/Style';
import { Button } from '../../stories/Button';

import MobileDefaultLayoutBottom from '../Default/MobileDefaultLayoutBottom';

const cx = classNames.bind(styles);

function BTConnect() {
  return (
    <>
      <div className={styles.Innerwrap}>
        <section className={styles.CommonPage}>
          <LogoTitle>AI 소리펜 로고 (가제)</LogoTitle>
          <ul>
            <li className={styles.imgBox}>
              <img src={pen} alt="" />
            </li>
            <li className={cx('mTxt')}>
              연결된 AI소리펜(가제)가
              <br />
              없어요.
            </li>
            <li className={cx('mTxt')}>지금 바로 연결할까요?</li>
            <li>
              {/* <Button type="submit" value="로그인">
                AI 소리펜(가제) 연결
              </Button> */}
              <Button type="button" buttonType="primary" isFull>
                asd
              </Button>
            </li>
          </ul>
        </section>
      </div>

      <MobileDefaultLayoutBottom />
    </>
  );
}
export default BTConnect;
